import React from 'react';
import { BrowserRouter, Route, Switch } from 'react-router-dom';
import './App.css';
import Navbar from './Components/Navbar/Navbar';
import PokemonListContainer from './Components/PokemonList/PokemonListContainer';
import CaughtPokemon from './Components/CaughtPokemon/CaughtPokemon';
import {Provider} from "react-redux";
import store from './redux/store_data';

function App(props) {
  return (
    <BrowserRouter>
      <Provider store={store}>
        <div className="App">
          <Navbar />
          <div>
            <Switch>
              <Route path='/' exact render={ () => <PokemonListContainer /> }/>
              <Route path='/caughtpokemon' render={ () => <CaughtPokemon store={props.store.pokemons}/> }/>
            </Switch>
          </div>
        </div>
      </Provider> 
    </BrowserRouter>
  );
}

export default App;
